import React from 'react';

const UserList = ({ users, onUpdate, onDelete }) => {
    return (
        <div>
            <h2>All Users</h2>
            <ul>
                {users.map((user) => (
                    <li key={user._id}>
                        <strong>{user.name}</strong>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default UserList;
